import "./Footerstyling.css";

import React from "react";
import { FaHome } from "react-icons/fa";

const Footer = () => {
  return (
    <div className="Footer">
      <div className="Footer-content">
        <div className="left">
          <div className="location">
            <FaHome size={20} />
          </div>
        </div>
        <div className="right"></div>
      </div>
    </div>
  );
};

export default Footer;
